import React from 'react';

const styles = {
  border: '1px solid black',
  margin: '12px',
  textAlign: 'center'
};

const ListItem = ({ item }) => {
  let title = item.categories[0].title;

  return (
    <div style={styles}>
      <h5>{item.name}</h5>
      <h6>{item.distance / 1000} kms</h6>
      <h6>{title}</h6>
    </div>
  );
};

export default ListItem;
